import logo from "./logo.svg";
import "./App.css";

import { Navbar, Nav, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

import "./Style.css";

export default function App() {
  return (
    <Navbar fluid className="Navbar">
      <Nav className="Menu" variant="pills" defaultActiveKey="/home">
        <Nav.Item>
          <Nav.Link className="Links mx-5" href="#home">
            Active
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="Links mx-5" eventKey="#service">
            Option 2
          </Nav.Link>
        </Nav.Item>
      </Nav>
    </Navbar>
  );
}
